            'accBallance':35545.25
        }
 ]

    return(
    <>
        <table>
        <th>
                <tr>ACC NUMBER</tr>
                <tr>NAME</tr>
                <tr>ACC BALLANCE</tr>
        </th>
         {accData.map((data)=>{

            <tr>
                <td>{data.AccNumber}</td>
                <td>{data.Name}</td>
                <td>{data.accBallance}</td>
            </tr>
         })}
        </table>
    </>
)}

export default Dashbord;
